import React from "react";
import "./App.css";
import {logo} from "./img/export"

const Navigation = () => {
    return (
        <ul className="navbar">
            <li><img alt="logo" src={logo}/></li>
            <li>sports</li>
            <li>about me</li>
            <li className="push">sign in</li>
            <li>register</li>
        </ul>
    )
}
export default Navigation;
